import React, { Component } from "react";
import Axios from "axios";
import baseURL from "../api/Github";
import RepoCard from "./RepoCard";
import { Grid } from "@mui/material";
import { Container } from "@mui/material";
import { Typography } from "@mui/material";
import { Button } from "@mui/material";
import { ButtonGroup } from "@mui/material";
import { useLocation, useNavigate } from "react-router-dom";

function GitHubCards() {
  const [repos, setRepos] = React.useState([]);
  const navigate = useNavigate();
  const location = useLocation();

  React.useEffect(() => {
    const fetchRepos = async () => {
      const api_key = process.env.REACT_APP_API_KEY;
      const url = "https://api.github.com/user/repos?type=all&sort=updated";
      const repoData = await Axios.get(url, {
        headers: {
          Authorization: `token ${api_key}`,
        },
      });
      setRepos(repoData.data);
    };
    fetchRepos();
  }, []);

  return (
    <div class="wrapper">
      <Container
        maxWidth="xl"
        sx={{
          display: "flex",
          justifyContent: "center",
          padding: 2,
          alignItems: "center",
        }}
      >
        <Grid
          container
          spacing={2}
          sx={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
          }}
        >
          <Grid item xs={12} sm={12} md={12}>
            <Typography variant="h4" paragraph gutterBottom>
              GitHub Projects
            </Typography>
          </Grid>
          {repos.slice(0, 6).map((data, i) => (
            <RepoCard repo={data} key={i} />
          ))}
          {!location.pathname.startsWith("/projects") && (
            <Grid item xs={12}>
              <Button
                variant="text"
                onClick={() => navigate("/projects")}
                sx={{ marginTop: "1rem" }}
              >
                View All
              </Button>
            </Grid>
          )}
        </Grid>
      </Container>
    </div>
  );
}

export default GitHubCards;
